description:
विराटनगरमा भएको मोटरसाइकल दुर्घटनामा राष्ट्रिय क्रिकेट खेलाडी मिनेष थापाको मृत्यु भएको छ ।&amp;nbsp;

विराटनगर महानगरपालिका&amp;ndash;५ निवासी २७ वर्षीय थापाको बिहीबार बिहान करिब १२ :५९ बजेतिर भएको दुर्घटनामा मृत्यु भएको हो ।

मोरङ प्रहरीका प्रवक्ता,

पछिल्लो समय नेपाली बजारमा केराको अभाव देखिनुका साथै मूल्य पनि आकासिएको छ ।&amp;nbsp;

सबैभन्दा कम केरा खपत हुने हिउँदको सिजनमा पनि केराको अभाव हुँदै मूल्य २०० देखि २५० रूपैयाँसम्म दर्जन पुगेको छ ।

